{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/tiageko/google-capstone-project-1?scriptVersionId=138814334\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","id":"ccc719ee","metadata":{"_cell_guid":"b1076dfc-b9ad-4769-8c92-a6c4dae69d19","_uuid":"8f2839f25d086af736a60e9eeb907d3b93b6e0e5","papermill":{"duration":0.010389,"end_time":"2023-08-03T16:13:22.453105","exception":false,"start_time":"2023-08-03T16:13:22.442716","status":"completed"},"tags":[]},"source":["# Google Capstone Project 1: \"How Does a Bike-Share Navigate Speedy Success?\"\n","\n","* > Author: Tiago Anjos\n","* > Date: 01-08-2023\n","\n","Welcome to my Google Capstone Project, this is my first time actually doing an analysis on my own, hope you enjoy!\n","\n","**Scenario**\n","\n","As a junior data analyst employed in the marketing analyst team at Cyclistic, a bike-share company located in Chicago, your crucial task revolves around maximizing the number of annual memberships for the company's future success. \n","To achieve this, your team aims to gain a deeper understanding of the contrasting behaviors of casual riders and annual members when using Cyclistic bikes. By uncovering valuable insights from this analysis, your team plans to develop a fresh marketing strategy aimed at converting casual riders into loyal annual members. However, before presenting your recommendations, they must be supported by compelling data insights and presented through professional data visualizations, as Cyclistic executives will need to approve the proposed strategy.\n","\n","Following the **6 steps of Data Processing**:\n","\n","1. **Ask**: Identify the main stakeholders in order to find the Business Task(Main Question) on how can your analysis help them\n","2. **Prepare**: Collect the data to be analysed\n","3. **Process**: Clean and Manipulate the data, whilst documenting all the actions taken\n","4. **Analyze**: Find the best tools and use them to transform and organize the data previously collected\n","5. **Share**: Visualize the key findings.\n","6. **Act**: Finalize with conclusions and recommendations\n","\n","\n","***ASK***\n","\n","Gather the insights on the user behaviours collected from the user database in order to share the best recommendations and conclusions with the stakeholders.\n","\n","**Main Question:** What's the contrasting behaviour differences between the annual members and casual members?\n","\n","**Stakeholders**: Lily Moreno (Director of Marketing), the Cyclistic Marketing Analytics Team and the Cyclistic Executive Team\n","\n","***Prepare***\n","\n","In this case study, I will be using [Cyclistic's historical trip data](https://divvy-tripdata.s3.amazonaws.com/index.html) from the past 6 months to conduct a comprehensive analysis and uncover significant trends. Motivate International Inc. has graciously made this data publicly available under a suitable [license](https://ride.divvybikes.com/data-license-agreement).\n","\n","By conducting this analysis within the confines of data privacy restrictions, I will be aiming find patterns in customer behavior, usage trends, and identify potential ways to convert Cyclistics casual members into annual members.\n","\n","**Files**\n","202211-divvy-tripdata.csv\n","202212-divvy-tripdata.csv\n","202301-divvy-tripdata.csv\n","202302-divvy-tripdata.csv\n","202303-divvy-tripdata.csv\n","202304-divvy-tripdata.csv\n","\n","\n"]},{"cell_type":"code","execution_count":1,"id":"349e55a1","metadata":{"execution":{"iopub.execute_input":"2023-08-03T16:13:22.476974Z","iopub.status.busy":"2023-08-03T16:13:22.47414Z","iopub.status.idle":"2023-08-03T16:13:23.848345Z","shell.execute_reply":"2023-08-03T16:13:23.846333Z"},"papermill":{"duration":1.389265,"end_time":"2023-08-03T16:13:23.851324","exception":false,"start_time":"2023-08-03T16:13:22.462059","status":"comp